//import React for creating components
import React from "react";

const List = ({ items }) => {
  return (
    <ul className="todo__list">
      {items.map((item) => (
        <li className="active">
          <i>{item.icon ? item.icon : <i className={item.color} />}</i>
          <span>{item.name}</span>
        </li>
      ))}
    </ul>
  );
};

export default List;
